import React from 'react';
import store from '../redux/store';
import { useParams } from 'react-router-dom';
import styles from './Nastavnici.module.css';
import { useSelector, useDispatch } from 'react-redux';

const Predmet = (props) => {
  const { idPredmet } = useParams();
  const predmeti = store.getState().predmeti.items;
  const predmet = useSelector((state) =>
    state.predmeti.filter((pred) => pred.idPredmet === +idPredmet)
  );
  console.log(predmet);

  return (
    <div>
      <p>
        {props.id} {props.naziv}
      </p>
      {idPredmet &&
        predmeti
          .filter((pred) => pred.idPredmet === +idPredmet)
          .map((pred) => {
            return (
              <div key={pred.idPredmet} className={styles.nastavnici}>
                <p>
                  {pred.idPredmet} {pred.naziv}
                </p>
              </div>
            );
          })}
    </div>
  );
};

export default Predmet;
